export interface PageProps {
    blocks: BlockProps[]
}
export const PageWithBlocks: React.FC<PageProps> = (props) => {
    return <>
        {props.blocks.map((v, i) => <Block title={v.title} leaders={v.leaders} key={i} />)}
    </>
}
